    // UPDATED to include all lyrics from all sources
    const allLyrics = [
        ...appData.nohay, ...appData.salaam, ...appData.manqabat, ...appData.farsinohay,
        ...appData.marsiyaCategories.flatMap(category => category.lyrics)
    ];

    // --- STATE MANAGEMENT (Favorites) ---
    let favorites = new Set(JSON.parse(localStorage.getItem('azaFavoritesV1')) || []);
    const saveFavorites = () => localStorage.setItem('azaFavoritesV1', JSON.stringify([...favorites]));
    const isFavorite = (id) => favorites.has(id);
    const toggleFavorite = (id) => {
        if (isFavorite(id)) { favorites.delete(id); } else { favorites.add(id); }
        saveFavorites();
    };

    // --- ROUTER ---
    const navigate = (hash) => { window.location.hash = hash; };

    function router() {
        const hash = window.location.hash || '#home';
        const [route, ...params] = hash.substring(1).split('/');
        
        app.innerHTML = '';
        app.className = '';
        
        switch (route) {
            case 'home':
                renderHomeScreen();
                break;
            case 'list':
                renderListScreen(decodeURIComponent(params[0]));
                break;
            case 'marsiya_list':
                renderMarsiyaListScreen();
                break;
            case 'detail':
                renderDetailScreen(parseInt(params[0]));
                break;
            case 'contact':
                renderContactUsScreen();
                break;
            case 'about':
                renderAboutUsScreen();
                break;
            default:
                renderHomeScreen();
        }
    }
    
    const createIcon = (name) => `<span class="material-symbols-outlined icon">${name}</span>`;

    // --- RENDER FUNCTIONS ---
    function renderHomeScreen() {
        app.classList.add('home-screen');
        app.innerHTML = `
            <img src="${logoBase64}" alt="Background Logo" class="home-background-logo">
            <div class="screen-container">
                <header class="home-header">
                    <h1>Aza-e-AbulFazlع</h1>
                    <button class="notification-button" id="notificationBtn">${createIcon('notifications')}</button>
                </header>
                <h2 class="home-section-title">Lyrics</h2>
                <div class="home-grid" id="lyrics-grid"></div>
                <h2 class="home-section-title">My Account</h2>
                <div class="home-grid" id="account-grid"></div>
            </div>
        `;

        const lyricsGrid = document.getElementById('lyrics-grid');
        const accountGrid = document.getElementById('account-grid');
        
        const lyricsCategories = [
            { name: "Nohay", icon: "book" }, { name: "Marsiya", icon: "book" },
            { name: "Salaam", icon: "book" }, { name: "Manqabat", icon: "book" },
            { name: "Farsi Nohay", icon: "book" }
        ];
        
        const accountCategories = [
            { name: "Favorites", icon: "bookmark" }, { name: "Contact Us", icon: "mail" },
            { name: "About Us", icon: "info" }
        ];
        
        lyricsCategories.forEach(cat => {
            const card = document.createElement('div');
            card.className = 'home-card';
            card.innerHTML = `${createIcon(cat.icon)}<p>${cat.name}</p>`;
            card.onclick = () => {
                if (cat.name === 'Marsiya') {
                    navigate('marsiya_list');
                } else {
                    navigate(`list/${cat.name}`);
                }
            };
            lyricsGrid.appendChild(card);
        });

        accountCategories.forEach(cat => {
            const card = document.createElement('div');
            card.className = 'home-card';
            card.innerHTML = `${createIcon(cat.icon)}<p>${cat.name}</p>`;
            card.onclick = () => {
                if (cat.name === 'Contact Us') navigate('contact');
                else if (cat.name === 'About Us') navigate('about');
                else navigate(`list/${cat.name}`);
            }
            accountGrid.appendChild(card);
        });

        document.getElementById('notificationBtn').onclick = renderNotificationDialog;
    }
    
    function renderListScreen(categoryName) {
        app.innerHTML = `
            <div class="screen-container">
                <header class="header">
                    <button class="back-button" onclick="history.back()">${createIcon('arrow_back')}</button>
                    <h1 class="title">${categoryName}</h1>
                </header>
                ${categoryName !== 'Favorites' ? `<div class="search-bar">
                    ${createIcon('search')}
                    <input type="text" id="searchInput" placeholder="Search by title or reciter...">
                </div>` : ''}
                <div class="lyric-list" id="lyricListContainer"></div>
            </div>
        `;
        
        const searchInput = document.getElementById('searchInput');
        const listContainer = document.getElementById('lyricListContainer');
        let lyricsToShow;
        if (categoryName === 'Favorites') {
            lyricsToShow = allLyrics.filter(l => isFavorite(l.id));
        } else {
            const key = categoryName.toLowerCase().replace(/\s/g, '');
            lyricsToShow = appData[key] || [];
        }
        const initialLyrics = [...lyricsToShow];
        
        const renderList = (lyrics) => {
            listContainer.innerHTML = '';
            if (lyrics.length === 0) {
                let emptyText = `Lyrics for "${categoryName}" will be added soon!`;
                if (categoryName === "Favorites") emptyText = "You haven't marked any lyrics as favorite yet.";
                else if (initialLyrics.length > 0) emptyText = `No results found for "${searchInput.value}".`;
                listContainer.innerHTML = `<p class="empty-list-message">${emptyText}</p>`;
                return;
            }
            lyrics.forEach(lyric => {
                const item = document.createElement('div');
                item.className = 'lyric-item';
                item.innerHTML = `<div class="lyric-item-details"><p>${lyric.title || '[Image]'}</p></div>${createIcon('chevron_right')}`;
                item.onclick = () => navigate(`detail/${lyric.id}`);
                listContainer.appendChild(item);
            });
        };
        renderList(initialLyrics);
        if (searchInput) {
            searchInput.addEventListener('input', (e) => {
                const query = e.target.value.toLowerCase();
                const filtered = initialLyrics.filter(l => l.title?.toLowerCase().includes(query) || l.reciter?.toLowerCase().includes(query));
                renderList(filtered);
            });
        }
    }

    function renderMarsiyaListScreen() {
        let expandedCategoryName = null;

        app.innerHTML = `
            <div class="screen-container">
                <header class="header">
                    <button class="back-button" onclick="history.back()">${createIcon('arrow_back')}</button>
                    <h1 class="title">Marsiya</h1>
                </header>
                <div class="search-bar" style="margin: 0 16px 16px 16px; width: auto;">
                    ${createIcon('search')}
                    <input type="text" id="searchInput" placeholder="Search Marsiya by title...">
                </div>
                <div id="marsiya-content"></div>
            </div>
        `;
        
        const searchInput = document.getElementById('searchInput');
        const contentContainer = document.getElementById('marsiya-content');

        const renderContent = () => {
            const query = searchInput.value.toLowerCase();
            contentContainer.innerHTML = '';

            if (query) {
                const filteredLyrics = appData.marsiyaCategories.flatMap(c => c.lyrics)
                    .filter(l => l.title?.toLowerCase().includes(query) || l.reciter?.toLowerCase().includes(query));
                
                const list = document.createElement('div');
                list.className = 'lyric-list';
                list.style.padding = '0 16px';

                if (filteredLyrics.length > 0) {
                    filteredLyrics.forEach(lyric => {
                        let reciterHTML = '';
                        if (lyric.reciter && lyric.reciter !== "UNKNOWN RECITER" && !lyric.reciter.startsWith("[")) {
                            reciterHTML = `<p class="reciter">${lyric.reciter}</p>`;
                        }
                        const item = document.createElement('div');
                        item.className = 'lyric-item';
                        item.innerHTML = `
                            <div class="lyric-item-details">
                                <p>${lyric.title || '[Image]'}</p>
                                ${reciterHTML}
                            </div>
                            ${createIcon('chevron_right')}
                        `;
                        item.onclick = () => navigate(`detail/${lyric.id}`);
                        list.appendChild(item);
                    });
                } else {
                    list.innerHTML = `<p class="empty-list-message">No results found for "${query}".</p>`;
                }
                contentContainer.appendChild(list);

            } else {
                const list = document.createElement('div');
                list.className = 'marsiya-list-container';
                appData.marsiyaCategories.forEach(category => {
                    const categoryDiv = document.createElement('div');
                    categoryDiv.className = 'marsiya-category';
                    categoryDiv.textContent = category.categoryName;
                    categoryDiv.onclick = () => {
                        expandedCategoryName = expandedCategoryName === category.categoryName ? null : category.categoryName;
                        renderContent();
                    };
                    list.appendChild(categoryDiv);

                    if (expandedCategoryName === category.categoryName) {
                        const lyricsContainer = document.createElement('div');
                        lyricsContainer.className = 'marsiya-lyrics-container';
                        if (category.lyrics.length > 0) {
                            category.lyrics.forEach(lyric => {
                                const lyricItem = document.createElement('div');
                                lyricItem.className = 'marsiya-lyric-item';
                                lyricItem.textContent = lyric.title || 'Untitled';
                                lyricItem.onclick = (e) => {
                                    e.stopPropagation();
                                    navigate(`detail/${lyric.id}`);
                                };
                                lyricsContainer.appendChild(lyricItem);
                            });
                        } else {
                            const emptyItem = document.createElement('div');
                            emptyItem.className = 'empty-marsiya-category';
                            emptyItem.textContent = 'Lyrics will be added soon.';
                            lyricsContainer.appendChild(emptyItem);
                        }
                        list.appendChild(lyricsContainer);
                    }
                });
                contentContainer.appendChild(list);
            }
        };

        searchInput.addEventListener('input', renderContent);
        renderContent();
    }


    function renderDetailScreen(lyricId) {
        const lyric = allLyrics.find(l => l.id === lyricId);
        if (!lyric) { app.innerHTML = `<div class="screen-container"><p>Lyric not found.</p></div>`; return; }
        const currentIsFavorite = isFavorite(lyric.id);
        
        app.innerHTML = `
            <div class="screen-container">
                <header class="header">
                    <button class="back-button" onclick="history.back()">${createIcon('arrow_back')}</button>
                    <h1 class="title">${lyric.title || 'Details'}</h1>
                </header>
                <div class="detail-controls">
                    <div class="control-group">
                        <button class="font-size-btn fs-1" data-size="16px">A</button>
                        <button class="font-size-btn fs-2 active" data-size="20px">A</button>
                        <button class="font-size-btn fs-3" data-size="24px">A</button>
                    </div>
                    <div class="control-group">
                        <button id="boldBtn">${createIcon('format_bold')}</button>
                        <button id="favBtn">${createIcon(currentIsFavorite ? 'bookmark' : 'bookmark_border')}</button>
                    </div>
                </div>
                <hr class="divider">
                <div class="detail-content-area" id="contentArea">
                    ${lyric.image ? `<img src="${lyric.image}" alt="${lyric.title}" class="detail-image">` : ''}
                    ${lyric.content ? `<p id="lyricText">${lyric.content.replace(/_/g, '')}</p>` : ''}
                     ${lyric.image && !lyric.content ? `<div class="zoom-container" id="zoomContainer">
                           <img src="${lyric.image}" alt="${lyric.title}" class="zoom-image" id="zoomImage">
                        </div>` : ''}
                </div>
            </div>
        `;
        
        const lyricText = document.getElementById('lyricText');
        const fontBtns = document.querySelectorAll('.font-size-btn');
        const boldBtn = document.getElementById('boldBtn');
        const favBtn = document.getElementById('favBtn');

        fontBtns.forEach(btn => {
            btn.onclick = () => {
                fontBtns.forEach(b => b.classList.remove('active'));
                btn.classList.add('active');
                if(lyricText) lyricText.style.fontSize = btn.dataset.size;
            };
        });
        
        boldBtn.onclick = () => {
            boldBtn.classList.toggle('active');
            if(lyricText) lyricText.style.fontWeight = boldBtn.classList.contains('active') ? 'bold' : 'normal';
        };

        favBtn.onclick = () => {
            toggleFavorite(lyric.id);
            favBtn.innerHTML = createIcon(isFavorite(lyric.id) ? 'bookmark' : 'bookmark_border');
        };

        const zoomContainer = document.getElementById('zoomContainer');
        if(zoomContainer) {
            const zoomImage = document.getElementById('zoomImage');
            let scale = 1, panning = false, pointX = 0, pointY = 0, start = { x: 0, y: 0 };
            const setTransform = () => { zoomImage.style.transform = `translate(${pointX}px, ${pointY}px) scale(${scale})`; }
            zoomContainer.onmousedown = (e) => { e.preventDefault(); start = { x: e.clientX - pointX, y: e.clientY - pointY }; panning = true; };
            zoomContainer.onmouseup = () => { panning = false; };
            zoomContainer.onmouseleave = () => { panning = false; };
            zoomContainer.onmousemove = (e) => { e.preventDefault(); if (!panning) return; pointX = (e.clientX - start.x); pointY = (e.clientY - start.y); setTransform(); };
            zoomContainer.onwheel = (e) => { e.preventDefault(); const xs = (e.clientX - pointX) / scale, ys = (e.clientY - pointY) / scale; const delta = (e.wheelDelta ? e.wheelDelta : -e.deltaY); (delta > 0) ? (scale *= 1.2) : (scale /= 1.2); scale = Math.min(Math.max(1, scale), 5); pointX = e.clientX - xs * scale; pointY = e.clientY - ys * scale; setTransform(); }
        }
    }

